import { Button, Checkbox, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, FormControlLabel, FormGroup, Grid, Typography } from "@material-ui/core";

const OptionDialog = ({openDialog,closeDialog}) => {
    
    const envs = [
        {name:"Production"},
        {name:"Validation"},
        {name:"Integration"},
        {name:"Développement"}
    ]
    return ( 
        <div>
            <Dialog
                    open={openDialog}
                    onClose={closeDialog}
                    fullWidth={200}
                    >
                        <DialogTitle id='dialog-option' >Options </DialogTitle>
                        <DialogContent>
                            <DialogContentText>
                                Personnaliser votre éxécution en fonction des environnements.
                            </DialogContentText>
                            <Grid container>
                                <Grid item>
                                    <Grid container>
                                        <Grid item md>
                                            <Typography>Environnement :</Typography>

                                        </Grid>
                                        <Grid item>
                                            <FormGroup row>
                                                { envs.map(env =>{
                                                    <FormControlLabel 
                                                    control={<Checkbox name="test"/>}
                                                    label={env.name}
                                                    />
                                                })}
                                                
                                                
                                            </FormGroup>

                                        </Grid>

                                    </Grid>

                                </Grid>

                                <Grid item>

                                </Grid>
                                
                            </Grid>

                        </DialogContent>
                        <DialogActions>
                            <Button>
                                Confirmer
                            </Button>
                            
                        </DialogActions>

                    </Dialog>
                    
        </div>
     );
}
 
export default OptionDialog;
